function calculate_date(e){console.log("fulldate: ");console.log(e);var t=e.split(" ");if(t==""){t[0]="00-00-0000";t[1]="00:00:00"}var n=t[0].split("-");var r=t[1].split(":");if(n[2]){var i=n[2]}else{var i="0000"}var s=n[1];if(s.length==1){s="0"+s}else{s="00"}var o=n[0];if(o.length==1){o="0"+o}else{o="00"}var u=r[0];if(u.length==1){u="0"+u}else if(u.length==2){u=u}else{u="00"}var a=r[1];if(a.length==1){a="0"+a}else if(a.length==2){a=a}else{a="00"}var f=r[2];if(f.length==1){f="0"+f}else if(f.length==2){f=f}else{f="00"}return(i+s+o+u+a+f)*1}jQuery.fn.dataTableExt.oSort["eu_date_time-asc"]=function(e,t){x=calculate_date(e);y=calculate_date(t);return x<y?-1:x>y?1:0};jQuery.fn.dataTableExt.oSort["eu_date_time-desc"]=function(e,t){x=calculate_date(e);y=calculate_date(t);return x<y?1:x>y?-1:0}